import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css'; // Assuming you will create a Navbar.css for styling

const Navbar = () => {
    return (
        <nav className="navbar">
            <ul>
                <li>
                    <Link to="/">Home</Link>
                </li>

            </ul>
        </nav>
    );
};

export default Navbar;
